import React from "react";
import "./journey.css";
import grass from "../images/grasspic.jpg"
import logo from "../images/websitelogo.jpg"

const Journey = () => {
  return (
    <div>
      <div className="journey">
        <div className="journeyimagea">
            <img src={grass}></img>
        </div>
        <div className="journeyimageb">
        <img src={grass}></img>
        </div>
      </div>
    </div>
  );
};

export default Journey;
